import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
//import MovieFilterIcon from "@mui/icons-material/MovieFilter";
import Toolbar from "@mui/material/Toolbar";
import { logoTextStyle } from "../styles";

const ZooLogo = require("/Users/Vlad/second-app/src/assets/zoo_logo.png");


const NavigationBarMd = ({ pages, handleCloseNavMenu }) => {
  return (
    <Toolbar >

      <Box
            component="img"
            src={ZooLogo}
            sx={{width: 90}}
          />
          <Typography
            variant="h5"
            noWrap
            component="a"
            href="/"
            sx={{
              ...logoTextStyle,
              display: { xs: "none", md: "flex" }, 
              alignSelf:"center",
              flexGrow: 1
            }}
          >
            MYZOO
          </Typography>
      <Box sx={{ flexGrow: 1, display: { xs: "none", md: "flex", mr: 10} }}>
        {pages.map((page) => (
          <Button
            key={page}
            onClick={handleCloseNavMenu}
            sx={{ my: 1, color: "white", display: "flex", alignContent: "right" }}
          >
            {page}
          </Button>
        ))}
      </Box>

    </Toolbar>
  );
};

export default NavigationBarMd;
